import React, { Component } from 'react';

class Forms extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }
    render() {
        return (
            <div id="page-wrapper" style={{ minHeight: '257px' }}>
                <div className="container-fluid">
                    <div className="row bg-title">
                        <div className="col-lg-12">
                            <h4 className="page-title">Validation Forms</h4>
                            <ol className="breadcrumb">
                                <li><a href="#">Dashboard</a></li>
                                <li className="active">Validation Forms Page</li>
                            </ol>
                        </div>
                        {/* /.col-lg-12 */}
                    </div>
                    {/* row */}
                    <div className="row">
                        <div>
                            <div className="white-box">
                                <h3>Form Validation</h3>
                                <p className="text-muted m-b-30"> Bootstrap Form Validation Datepicker </p>
                                <form data-toggle="validator" noValidate="true">
                                    <div className="form-group" className="col-sm-6">
                                        <label htmlFor="inputName1" className="control-label">Name</label>
                                        <input type="text" className="form-control" id="inputName1" placeholder="Cina Saffary" required />
                                    </div>
                                    <div className="form-group">
                                        <label htmlFor="inputName1" className="control-label">Name</label>
                                        <input type="text" className="form-control" id="inputName1" placeholder="Cina Saffary" required />
                                    </div>
                                </form>
                            </div>
                        </div>
                    </div>
                    {/* /.row */}
                </div>
                {/* /.container-fluid */}
            </div>
        );
    }
}

export default Forms;
